package com.etrack.myapplication.model.inputService;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class ReportByItemCat {    @SerializedName("objitem")    @Expose    private Objitem objitem;    public Objitem getObjitem() {        return objitem;    }    public void setObjitem(Objitem objitem) {        this.objitem = objitem;    }    public class Objitem {        @SerializedName("company_id")        @Expose        private String companyId;        @SerializedName("item_code")        @Expose        private String itemCode;        @SerializedName("category_code")        @Expose        private String categoryCode;        public String getCompanyId() {            return companyId;        }        public void setCompanyId(String companyId) {            this.companyId = companyId;        }        public String getItemCode() {            return itemCode;        }        public void setItemCode(String itemCode) {            this.itemCode = itemCode;        }        public String getCategoryCode() {            return categoryCode;        }        public void setCategoryCode(String categoryCode) {            this.categoryCode = categoryCode;        }    }}